import React, {useEffect} from "react";
import {Link} from "react-router-dom";
import AlgorithmScreen from "./AlgorithmScreen";
import data from "../data";

function ArrayMainScreen(props) {

    useEffect( () => {

        return () => {
            //
        };
    }, )

    return (
        <div className="algorithms">
            <p>Select an algorithm you want to see!</p>
            <ul>
            {
                data.algorithms.map(algorithm =>
                        <li>
                            <Link to={"/algorithm/" + algorithm._id} id={1}>{algorithm.name}</Link>
                        </li>)

            }
            </ul>
            </div>

    )
};

export default ArrayMainScreen;
